import React from 'react';

const Buscador = () => {
    return (  
      <div className="container">
        <h3>Aquí podrás encontrar tú planta favorita para cocinar, plantar o decorar</h3>
      <input className="form-control" id="myInput" type="text" placeholder="Encuentra tu planta favorita.." />
      <div id="myDIV">
      </div></div>
    );
}
 
export default Buscador;
